import React from 'react';
import '../';

const CustomerCard = ({ customer }) => (
  <div className="customer-card">
    <h3>{customer.name}</h3>
    <p>Email: {customer.email}</p>
    <p>Orders: {customer.orderCount}</p>
  </div>
);

export default CustomerCard;
